- input: TEXT,F3XA,,"You have requested clarification regarding the payments received
    by the Alaska Democratic Party from the Knowles for Senate campaign disclosed
    on Line 15 of the May Monthly report.  The monies received by the Alaska Democratic
    Party reflect reimbursement for staff salaries and other office expenses for a
    portion of the ADP's field program a portion of which has been determined to be
    directly on behalf of and therefore allocable to Tony Knowles for Senate.  See
    11 C.F.R.  106.1.  The amount allocated to the Knowles for Senate campaign reflects
    a determined percentage of staff salaries as well as other office expenses such
    as rent and office supplies for the portion of the field staff's time spent working
    directly for the Knowles campaign.  The Knowles campaign intends to pay for a
    portion of these activities on a regular basis.  The amounts spent over and above
    this amount each month by the ADP for these activities will be disclosed as a
    coordinated expenditure on behalf of the Knowles for Senate campaign pursuant
    to 2 U.S.C.  441a(d) by the ADP on Line 25 of its monthly reports.",
